package com.MITProject.TravelerHelperBot.botService;import org.springframework.beans.factory.annotation.Value;import org.springframework.stereotype.Component;import org.telegram.telegrambots.bots.TelegramWebhookBot;import org.telegram.telegrambots.meta.api.methods.BotApiMethod;import org.telegram.telegrambots.meta.api.objects.Update;@Componentpublic class TelegramWebHooksService extends TelegramWebhookBot {    @Value("${telegram.bot.username}")    private String botUsername;    @Value("${telegram.bot.token}")    private String botToken;    @Value("${telegram.bot.webhookPath}")    private String webhookPath;    @Value("${stripe.api}")    private String stripeKey;    @Override    public String getBotPath() {        return webhookPath;    }    @Override    public String getBotUsername() {        return botUsername;    }    @Override    public String getBotToken() {        return botToken;    }    @Override    public void onRegister() {        super.onRegister();    }    @Override    public BotApiMethod<?> onWebhookUpdateReceived(Update update) {        return null;    }}